import './App.css';
import './components/'

function App() {

  let todoList = ['Morning routine', 'Coding' , 'Workout', 'Time w fav people']


  return (
    <div className="App">
      <ul>
        {todoList.map((todo, i) => <li type='none' key = {i}>Task: {todo}</li>)}
      </ul>
    </div>
  );
}

export default App;
